import React from 'react';
import {read_cookie} from 'sfcookies'

const Home = () => {
    function check() {
        const cookie = read_cookie('jwt')
        if (cookie.length === 0) console.log('Unauth')
    }

    check()
    return (
        <div>
            Welcome To Home
        </div>
    );
};


export default Home;
